// /src/pages/HomePage/Testimonials.js
import React from "react";
import TestimonialCard from "../../components/HomePage/TestimonialCard";
import "../../styles/HomePage/Testimonials.css";

const Testimonials = () => {
  const feedback = [
    {
      name: "Dr. Kavitha",
      role: "Cardiologist",
      image: "doc1.jpg",
      quote: "This platform has revolutionized the way I consult patients remotely.",
    },
    {
      name: "Ravi Kumar",
      role: "Patient",
      image: "patient1.jpg",
      quote: "AyuRaksha helped me book my test and consult the doctor easily!",
    },
  ];

  return (
    <section className="testimonials">
      <h2>What Our Users Say</h2>
      <div className="testimonial-cards">
        {feedback.map((item, index) => (
          <TestimonialCard key={index} {...item} />
        ))}
      </div>
    </section>
  );
};

export default Testimonials;
